import { Box } from "@mui/material"
const Summation = ({ breakfast, lunch, dinner, snacks }) => {
  return (

    <Box sx={{flexDirection:'column'}}>
      <Box sx={{width:'100%'}}>Summation</Box>
      <Box sx={{width:'100'}}>{breakfast.reduce((total,food)=>(total+food.cal),0)}</Box>
      <Box></Box>
      <Box></Box>
      <Box></Box>
    </Box>
  )
}

export default Summation
